import styled from 'styled-components';

const Header = (props) => {
    return (
        <Container> 
            <Content>
                <Logo>
                    <a href="/home">
                    <img src="/images/home-logo.svg" alt="home-logo" />
                    </a>
                </Logo>
                <Search>
                    <div>
                        <input type="text" placeholder="Search" />
                    </div>
                    <SearchIcon>
                        <img src="/images/search-icon.svg" alt="search-icon" />
                    </SearchIcon>
                </Search>
                <Nav>
                    <NavListWrap>
                        <NavList class="active">
                            <a>
                                <img src="/images/nav-home.svg" alt="nav-home-icon" srcset=""/>
                                <span>Home</span>
                            </a>
                        </NavList>

                        <NavList>
                            <a>
                                <img src="/images/nav-network.svg" alt="nav-network" />
                                <span>My Network</span>
                            </a>
                        </NavList>

                        <NavList>
                            <a>
                                <img src="/images/nav-jobs.svg" alt="nav-jobs" />
                                <span>Jobs</span>
                            </a>
                        </NavList>

                        <NavList>
                            <a>
                                <img src="/images/nav-messaging.svg" alt="" />
                                <span>Messaging</span>
                            </a>
                        </NavList>  

                        <NavList>
                            <a>
                                <img src="/images/nav-notifications.svg" alt="" />
                                <span>Notifications</span>
                            </a>
                        </NavList>    

                        <User>
                            <a>
                                <img src="/images/user.svg" alt="" />
                                <span>Me</span>
                                <img src="/images/down-icon.svg" alt="" />
                            </a>

                            <SignOut>
                                <a>Sign Out</a>
                            </SignOut>
                        </User>          

                        <Work>
                            <a>
                                <img src="/images/nav-work.svg" alt="" />
                                <span>
                                Work
                                <img src="/images/down-icon.svg" alt="" />
                                </span>
                            </a>
                        </Work>        

                    </NavListWrap>
                </Nav> 
            </Content>
        </Container>
    );
};

const Container = styled.div`
    background-color: white;
    border-bottom: 1px solid rgba(0,0,0,0.08);
    left: 0;
    padding: 0 24px;
    position: fixed;
    top: 0;
    width: 100vw;
    z-index: 100;
`;

const Content = styled.div`
    display: flex;
    align-items: center;
    margin: 0 auto;
    min-height: 100%;
    max-width: 1128px;
`;

const Logo = styled.span`
    margin-right: 8px;
    font-size: 0px;
`;

const Search = styled.div`
    opacity: 1;
    flex-grow: 1;
    position: relative;
    & > div{
        max-width: 280px;
        input{
            border: none;
            box-shadow: none;
            background-color: #eef3f8;
            border-radius: 2px;
            color: rgba(0, 0, 0, 0.9);
            width: 400;
            font-size: 14px;
            height: 34px;
            border-color: #dce6f1;
            vertical-align: text-top;
            line-height: 1.75;
        }
    }
`;
const SearchIcon = styled.div`
    width: 40px;
    position: absolute;
    z-index: 1;
    top: 10px;
    left: 2px;
    border-radius: 0 2px 2px 0;
    margin: 0;
    pointer-events: none;
    display: flex;
    justify-content: center;
    align-items: center;    
`;

const Nav = styled.nav`
    margin-left: auto;
    display: block;
    @media (max-width: 768px) {
        position: fixed;
        left: 0;
        bottom: 0;
        background: white;
        width: 100%;

    }
`
const NavListWrap = styled.ul`
    display: flex;
    flex-wrap: nowrap;
    list-style-type: none;

    .active{
        span:after{
            content:"";
            transform: scaleX(1);
            border-bottom: 2px solid var(--white, fff);
            bottom: 0;
            left: 0;
            position: absolute;
            transition: transform 0.2 ease-in-out;
            width: 100%;
            border-color: rgba(0,0,0,0.9);

        }
    }
`;

const NavList = styled.li`
    display: flex;
    align-items: center;
    a{
        align-items: center;
        background: transperent;
        display: flex;
        flex-direction: column;
        font-size: 12px;
        font-weight: 400;
        justify-content: center;
        line-height: 1.5;
        min-height: 42px;
        min-width: 88px;
        position: relative;
        text-decoration: none;

        span {
            color: rgba(0, 0, 0, 0.6);
            display: flex;
            align-items: center;
        }

        @media (max-width: 768px){
            min-width: 70px;
        }

        &:hover, &:active {
            a{
                span{
                    color: rgba(0, 0, 0, 0.9);
                }
            }
        }

    }
`;

const User = styled(NavList)`
    a < svg
    width: px;
`;

const SignOut = styled.a`

`;

const Work = styled(User)`

`;

export default Header;
